import React from "react";
import styles from '../styles/pago.module.css';
import { PayPalScriptProvider, PayPalButtons } from "@paypal/react-paypal-js";
import { initMercadoPago, Checkout } from '@mercadopago/sdk-react';

const PAYPAL_CLIENT_ID = 'AdwObl8zvI4sB0iG1UJi85kaIBMaL8wQkh6obtqTqNIrS-z7gVfM7KZB61jlnzC_w9zMzuIJDDeO-DuS';
const MERCADOPAGO_PUBLIC_KEY = 'TEST-b17ac1d1-6acf-4b6c-ac1b-01e05efd2fca';
const PRECIO = '129';

function Pago() {
  initMercadoPago(MERCADOPAGO_PUBLIC_KEY);

  const handlePaymentSuccess = (details) => {
    // Lógica a ejecutar después de que el pago se haya completado correctamente
    console.log('Pago completado:', details);
  };

  return (
    <div>
      <PayPalScriptProvider options={{ "client-id": PAYPAL_CLIENT_ID, "currency": "MXN" }}>
        <header className={styles.Cabecilla}>
          <p className={styles.Idioma}>México (Español)</p>
        </header>

        <section className={styles.Ramt}>
          <div className={styles.suscribcion}>
            <div className={styles.perfil}>
              <span className={styles.circulo}><img src={require('../images/user.svg')} alt="" /></span>
              <span className={styles.nombre}>Tu perfil</span>
              <span><img src={require('../images/salir.svg')} alt="" /></span>
            </div>
          </div>

          <article className={styles.Mediante}>
            <div className={styles.nest}>
              <p className={styles.Plan}>Tu plan</p>
              <p className={styles.Cambiar}></p>
            </div>
            <div className={styles.cajamedio}>
              <div className={styles.Par1}>
                <p className={styles.PILL}>Premium</p>
                <p className={styles.PILLS}>Cuenta Premium</p>
              </div>
              <div className={styles.Par2}>
                <p className={styles.PILL2}>A partir de Hoy</p>
                <p className={styles.PILL2}>Próxima fecha de facturación: 12/12/2023</p>
              </div>
            </div>

            <div className={styles.cajamedio}>
              <div className={styles.Par1}>
                <p className={styles.PILL}>Método de pago</p>
                <p className={styles.PILLS}>Tarjeta de crédito</p>
              </div>
              <div className={styles.Par2}>
                <Checkout
                  preference={{
                    items: [
                      {
                        title: 'Cuenta Premium',
                        unit_price: parseInt(PRECIO),
                        quantity: 1,
                      },
                    ],
                  }}
                  publicKey={MERCADOPAGO_PUBLIC_KEY}
                  onPayment={() => console.log('Pago completado')}
                >
                  <button>Comprar con MercadoPago</button>
                </Checkout>
              </div>
            </div>

            <div className={styles.cajamedio}>
              <div className={styles.Par1}>
                <p className={styles.PILL}>Detalles de la factura</p>
                <p className={styles.PILLS}>129 MXN/mes</p>
              </div>
              <div className={styles.Par2}>
                <PayPalButtons
                  createOrder={(data, actions) => {
                    return actions.order.create({
                      purchase_units: [
                        {
                          amount: {
                            value: PRECIO,
                          },
                        },
                      ],
                    });
                  }}
                  onApprove={(data, actions) => {
                    return actions.order.capture().then(handlePaymentSuccess);
                  }}
                />
              </div>
            </div>
          </article>

        </section>

      </PayPalScriptProvider>
    </div>
  );
}

export default Pago;
